Shaun Rowley is with Farrah 'Schraut' Rowley at Royalton Elementary.
May 5 at 12:52 PM · Royalton, MN ·

@RoyaltonRoyals posted this "Pass the Marker" challenge: https://www.facebook.com/RoyaltonRoyals/videos/2585161091741685/ and we are joining in. Homeschooling isn't easy, but we are so grateful to have amazing support to help our little guys learn in new and different ways.
